import React, { useState } from 'react'
import DataTable from '../../components/users/DataTable'
export default function Admin() {
  const [addBtn, setAddBtn] = useState(false);
  return (
    <div className="content-wrapper">
      <div className="content-header">
        <div className="container-fluid">
          <div className="row mb-2">
            <div className="col-sm-9"><h1 className="m-0">Админ</h1></div>{/* /.col */}
            <div className="col-sm-3">
              { addBtn ? 
                <button type="button" className="btn btn-block btn-success" onClick={()=>setAddBtn(false)}>Буцах</button>
              :
                <button type="button" className="btn btn-block btn-success" onClick={()=>setAddBtn(true)}>Админ хэрэглэгч нэмэх</button>
              }
              
            </div>
          </div>{/* /.row */}
        </div>{/* /.container-fluid */}
      </div> 
      <div className="content">
        <div className="container-fluid">
          <div className="row">
              <DataTable roles="admin" addBtn={addBtn}/>
          </div>
        </div>
      </div>
    </div>
  )
}
